// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/ERC1967/ERC1967Proxy.sol";

contract SolvineProxy {
    address public immutable implementation;
    address public immutable admin;

    constructor(address _implementation, address _admin) {
        implementation = _implementation;
        admin = _admin;
    }

    function deploy(uint256 initialSupply, uint256 maxSupply) external returns (address) {
        address proxyAddress = address(new ERC1967Proxy(implementation, abi.encodeWithSignature("initialize(uint256,uint256)", initialSupply, maxSupply)));
        return proxyAddress;
    }
}
